import React from 'react';
import classes from './Salad.module.css';


const Salad = (props) => {
    return (
        <div className={classes.Salad}>

            <img className={classes.plate} src="https://emojipedia-us.s3.dualstack.us-west-1.amazonaws.com/thumbs/120/apple/237/fork-and-knife-with-plate_1f37d.png" alt='saladPlate'/>
        </div>
    );
}

export default Salad;
